class Solution extends Component {

    hint(hintContent){
        return(
            hintContent
        )
    }

    render() {
        return (
            <div>
                <div>{this.hint("She is blond and cute and likes to poop, and she used to be a puppy once")}</div>
                
            </div>
        );
    }
}

export default Solution;
